import React from "react"
import "./Pricing.css"


const data = [
    {
      employeeId: '01',
      name: 'John Doe',
      email: 'johndoe@email.com',
      position: 'Frontend Developer',
    },
    {
      employeeId: '02',
      name: 'Sara',
      email: 'sara@email.com',
      position: 'HR Executive',
    },
    {
      employeeId: '03',
      name: 'Mike',
      email: 'mike@email.com',
      position: 'Backend Developer',
    },
  ]
  
  const Pricing = () => {
    const [employeeData, setEmployeeData] = React.useState(data)
  
    const onChange = (e, employeeId) => {
      const { name, value } = e.target
  
      const editData = employeeData.map((item) =>
        item.employeeId === employeeId && name ? { ...item, [name]: value } : item
      )
  
      setEmployeeData(editData)
    }
  
    return (
      <div className="container">
        <h1 className="title">GST Registraton Pricing</h1>
        <table>
          <thead>
            <tr>
              <th></th>
              <th>Free Plan</th>
              <th>Standard Plan</th>
            </tr>
          </thead>
          <tbody>
            {employeeData.map(({ employeeId, name, email, position }) => (
              <tr key={employeeId}>
                <td>
                 { <input
                    name="name"
                    value={name}
                    type="text"
                    onChange={(e) => onChange(e, employeeId)}
                    placeholder="Type Name"
                  />}
                </td>
                <td>
                 {email}
                </td>
                <td>
                 {position}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    )
  }
  
  export default Pricing;
